import {React, Fragment} from 'react';


function Pregunta() {

    return(
        <Fragment>
            <h2>Coloca tu presupuesto</h2>
            <form>
                <input
                    type="number"
                    className="u-full-width"
                    placeholder="Coloca tu presupuesto"/>
                
                <input type="submit"/>

            </form>
        </Fragment>
    );
}

export default Pregunta;
